import { UserOutlined, HistoryOutlined, MessageOutlined } from '@ant-design/icons';
const siderMenu = [
    {
        'id': 'menu.friend',
        'icon': UserOutlined,
    },
    {
        'id': 'menu.history',
        'icon': HistoryOutlined,
    },
    {
        'id': 'menu.message',
        'icon': MessageOutlined,
    }
];

export default {
    ...siderMenu
}
